import React from 'react';
import '../App.css';
import logo from '../logo.svg';

function Nav() {
  return (
    <nav>
      <h3>Logo</h3>
      <ul>
          <li>About</li>
          <li>Events</li>
      </ul>
    </nav>
  );
}

export default Nav;
